import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomePage from "./pages/HomePage";
import Nav from "./components/Nav";

function App() {
  <BrowserRouter>
    <div className="App">
      <Nav />
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </div>
  </BrowserRouter>;
  return <h1>This is the start of the end!</h1>;
}

export default App;
